import React, { useEffect, useState } from "react";
import FeedBox from "./FeedBox";
import "./Feed.style.css";
import Post from "../Post/Post.component";
import axios from "axios";


function Feed(props) {
  const [listposts, setListPosts] = useState([{id:1,userid:10,feed:"Hi there",username:"manav"}]);

  useEffect(() => {
    async function handlePosts() {
      try {
        const posturl = `http://localhost:8000/api/posts/`;
        const postdata = await axios.get(posturl).then(response => {
          setListPosts(response.data);
        })
      }
      catch (e) {
        console.log(e);
      }
    }
    try {
      handlePosts();
    }
    catch (e) {
      console.log(e);
    }

  },[])

  return (
    <div className="feed">
      <FeedBox  userid={props.userid} username={props.username}/>
      {listposts.map((post) => (
        <div key = {post.id}>
        <Post
          key={post.id}
          userid={post.userid}
          usersname={post.username}
          feed = {post.feed}

        />
        </div>
      ))}
    </div>
  );
}

export default Feed;
